# Creates on-the-fly a FREEDOS bootable floppy 1.44M image
import base64, bz2, sys, os
from FATtools import Volume, mkfat

DEBUG=int(os.getenv('FATTOOLS_DEBUG', '0'))

if DEBUG:
    import logging
    logging.basicConfig(level=logging.DEBUG, filename='mk_fdos12_boot_floppy.log', filemode='w')

# FREEDOS 1.2 BINARIES (bzipped and base64 encoded)
FREEDOS_12_BOOT = ''
FREEDOS_12_KERNELSYS = ''
FREEDOS_12_COMMANDCOM = ''


bootable = {
'system': 'FREEDOS 1.2',
'date': (2016,5,11),
'time': (1,2,0),
'boot': FREEDOS_12_BOOT,
0: ('KERNEL.SYS', FREEDOS_12_KERNELSYS),
1: ('COMMAND.COM', FREEDOS_12_COMMANDCOM)
}

floppy_size = 1440<<10

if len(sys.argv) == 1:
    sys.argv += ['FLOPPY.IMG']

print('Creating a %d KiB bootable floppy with %s'%(floppy_size//1024, bootable['system']))

# Make floppy image
f = open(sys.argv[1],'wb'); f.seek(floppy_size); f.truncate(); f.close()

# Format & add boot code
f = Volume.vopen(sys.argv[1], 'r+b', 'disk')
mkfat.fat_mkfs(f, floppy_size)
f.seek(0)
boot = f.read(512)
bootcode = base64.b64decode(bootable['boot'])
jmp = bootcode[1] # boot code jmp offset
boot[1] =  jmp
boot[1+jmp:] = bootcode[1+jmp:]
boot[3:11] = bootcode[3:11] # FAT label
f.seek(0)
f.write(boot)
f.close()

print('Copying system...')
f = Volume.vopen(sys.argv[1], 'r+b')

for i in range(2):
    h = f.create(bootable[i][0])
    buf = bz2.decompress(base64.b64decode(bootable[i][1]))
    print('%s, %d bytes' % (bootable[i][0], len(buf)))
    h.write(buf)
    h.Entry.wMDate = h.Entry.MakeDosDate(bootable['date'])
    h.Entry.wMTime = h.Entry.MakeDosTime(bootable['time'])
    h.Entry.chDOSPerms = 1 | 2 | 4 # Hidden, System, Read-Only
    h.Entry.wCDate = 0
    h.Entry.wCTime = 0
    h.Entry.wADate = 0
    h.close()

Volume.vclose(f)


# Injects the floppy directory, if found
if os.path.exists('./floppy'):
    print('Copying additional files...')
    Volume.copy_tree_in('./floppy', f)
